export default function FormAction({
    handleSubmit,
    type='Button',
    action='submit',
    text,
    btn
}){
    return(
        <div className="px-10">
        {type==='Button' ?
            <button type={action} className={btn} onSubmit={handleSubmit} >
                 {text} 
            </button>
            :
            <></>
        }
        </div>
    )
}
